import React from "react"
import Header from "./Header.js"
import MetrixMaker from "./MetrixMaker.js"


class App extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            pageName: "MetricMaker"
        }
    }

    render() {
        switch(this.state.pageName) {
            case "MetricMaker":
                return (
                    <div>
                        <Header />
                        <MetrixMaker />
                    </div>
                )
            default:
                return (
                    <div>

                    </div> 
                )
        }
    }
}

export default App
